import './App.css';

function About() {
  return (
    <main className='container'>
      Witam Was. Ten blog prezentuje działania biblioteki szkolnej. Nasza biblioteka posiada duży wybór literatury dla dzieci i młodzieży. Nauczyciel bibliotekarz co roku uczestniczy w projektach edukacyjnych promujących czytelnictwo, organizuje lekcje biblioteczne, zajęcia czytelnicze, warsztaty plastyczne i spotkania kółka czytelniczego. Organizuje także konkursy, współpracuje z instytucjami oraz uczestniczy w licznych szkoleniach. O wszystkich działaniach tu przeczytacie. Na blogu umieszczony jest link do katalogu książek jakie posiada biblioteka. Zapraszam do wspólnej przygody. 
    </main>
  );
}

export default About;
